INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100101, "人助けが大好き！　前向き格闘娘", 155, 8, "ヒヨリ", 2, 0, "トゥインクルウィッシュ", 16, "人助け、応援", 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "A", "獣人族", "東山奈央");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100201, "戦闘のサポートが得意な、心優しい少女", 158, 4, "ユイ", 2, 0, "トゥインクルウィッシュ", 17, "料理、人間観察", 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "O", "ヒューマン", "種田梨沙");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100301, "クールで何事にも真っ直ぐな剣士", 163, 1, "レイ", 2, 0, "トゥインクルウィッシュ", 18, "読書、乗馬、お茶", 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "B", "魔族", "早見沙織");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100401, "探検好きのイタズラっ子", 128, 8, "ミソギ", 5, 0, "リトルリリカル", 9, "いたずら、探検", 27, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 10, "O", "ヒューマン", "諸星すみれ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100501, "ヒーローに憧れる騎士見習いの少女", 146, 11, "マツリ", 8, 0, "王宮騎士団（NIGHTMARE）", 12, "ヒーローごっこ", 40, "？？？", 25, "O", "獣人族", "下田麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100601, "甘え上手なみんなの人気者", 150, 11, "アカリ", 7, 0, "悪魔偽王国軍（ディアボロス）", 13, "サックス", 42, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 22, "O", "魔族", "浅倉杏美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100701, "プリン大好きゴースト娘", 130, 1, "ミヤコ", 7, 0, "悪魔偽王国軍（ディアボロス）", 14, "プリンを食べること", 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, "B", "魔族", "雨宮天");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100801, "ボクは誰よりも美しい", 150, 10, "ユキ", 15, 0, "ヴァイスフリューゲル　ランドソル支部", 14, "鏡で自分を見ること", 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "AB", "エルフ", "大空直美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100901, "前世を信じる中二病患者、「疾風の冥姫」", 159, 7, "アンナ", 13, 0, "トワイライトキャラバン", 17, "小説執筆", 45, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 5, "A", "魔族", "髙野麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101001, "マホマホ王国のプリンセス", 155, 9, "マホ", 10, 0, "自警団（カォン）", 16, "空想、ぬいぐるみ集め", 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, "O", "獣人族", "内田真礼");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101101, "人懐っこくてマシンガントークな妹系少女", 156, 8, "リノ", 3, 0, "ラビリンス", 15, "お裁縫", 44, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 25, "A", "ヒューマン", "阿澄佳奈");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101201, "みんなのために超能力を使う眠り姫", 156, 12, "ハツネ", 6, 0, "フォレスティエ", 17, "妹と遊ぶこと、二度寝、昼寝、早寝", 46, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 24, "A", "エルフ", "大橋彩香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101301, "オタク全開な魔法少女", 166, 8, "ナナカ", 13, 0, "トワイライトキャラバン", 18, "読書、魔法", 55, "", 21, "O", "魔族", "佳村はるか");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101401, "頭脳明晰な美少女名探偵", 152, 11, "カスミ", 10, 0, "自警団（カォン）", 15, "読書、推理", 41, "test", 3, "AB", "獣人族", "水瀬いのり");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101501, "母性溢れる優しいみんなの「ミサト先生」", 165, 9, "ミサト", 6, 0, "フォレスティエ", 21, "絵本作り", 54, "test", 5, "O", "エルフ", "國府田マリ子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101601, "天真爛漫で人気者のカリスマモデル", 167, 4, "スズナ", 14, 0, "ルーセント学院", 18, "ファッション", 48, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 10, "O", "魔族", "上坂すみれ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101701, "いつでも「なんくるないさ～」な天然娘", 158, 7, "カオリ", 10, 0, "自警団（カォン）", 19, "踊り、空手", 53, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, "A", "獣人族", "高森奈津美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101801, "多くの男性を魅了する無垢な女教師", 162, 8, "イオ", 14, 0, "ルーセント学院", 23, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 52, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "B", "魔族", "伊藤静");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102001, "お歌もにんじんも、ウサギさんも大好き♪", 117, 4, "ミミ", 5, 0, "リトルリリカル", 10, "かわいいもの集め", 21, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 3, "O", "獣人族", "日高里菜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102101, "泣き虫で臆病な守ってあげたい女の子", 150, 6, "クルミ", 9, 0, "サレンディア救護院", 12, "観劇、おままごと", 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "B", "ヒューマン", "植田佳奈");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102201, "人見知りであまのじゃくな女の子", 150, 11, "ヨリ", 7, 0, "悪魔偽王国軍（ディアボロス）", 13, "ゲーム全般", 40, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 22, "O", "魔族", "原紗友里");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102301, "ぷうきちといつも一緒！", 148, 5, "アヤネ", 9, 0, "サレンディア救護院", 14, "屋内でできる遊び", 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "B", "ヒューマン", "芹澤優");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102501, "お嬢さまのためにがんばるドジっ娘メイド", 154, 12, "スズメ", 9, 0, "サレンディア救護院", 15, "ご奉仕", 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "O", "ヒューマン", "悠木碧");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102601, "遊びと睡眠が何より大事なぐうたら娘", 144, 1, "リン", 11, 0, "牧場（エリザベスパーク）", 17, "あんパン", 42, "test", 1, "B", "獣人族", "小岩井ことり");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102701, "運命の相手に一途すぎる乙女", 154, 7, "エリコ", 13, 0, "トワイライトキャラバン", 16, "実験、裁縫、料理", 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, "B", "魔族", "橋本ちなみ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102801, "救護院を経営する優しい庶民派お嬢様", 156, 10, "サレン", 9, 0, "サレンディア救護院", 17, "経営、お茶会", 43, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 4, "A", "エルフ", "堀江由衣");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102901, "歌って踊れる大人気アイドル", 157, 1, "ノゾミ", 4, 0, "カルミナ", 17, "舞台鑑賞、ダンス", 40, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 24, "B", "ヒューマン", "日笠陽子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103001, "トーゴクの神秘、オシエテクダサイ！", 163, 8, "ニノン", 15, 0, "ヴァイスフリューゲル　ランドソル支部", 16, "忍法開発", 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 31, "O", "ヒューマン", "佐藤聡美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103101, "占いが得意な霊能少女", 157, 12, "シノブ", 7, 0, "悪魔偽王国軍（ディアボロス）", 18, "占い", 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "AB", "魔族", "大坪由佳");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103201, "一人前の商人を目指すパワフルお嬢様", 157, 3, "アキノ", 12, 0, "メルクリウス財団", 18, "慈善事業", 45, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "AB", "ヒューマン", "松嵜麗");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103301, "みんなを笑顔にするお笑い牧場主", 142, 3, "マヒル", 11, 0, "牧場（エリザベスパーク）", 20, "漫才", 35, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, "B", "ヒューマン", "新田恵海");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103401, "純情でほっとけない大人の女性", 164, 3, "ユカリ", 12, 0, "メルクリウス財団", 22, "ウインドーショッピング", 55, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 16, "A", "エルフ", "今井麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103601, "礼儀正しくしっかり者のちびっ子優等生", 118, 2, "キョウカ", 5, 0, "リトルリリカル", 8, "お勉強", 21, "test", 2, "A", "エルフ", "小倉唯");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103701, "義理堅くてからかい好きな剣術少女", 149, 8, "トモ", 8, 0, "王宮騎士団（NIGHTMARE）", 13, "剣術、年長者をからかう", 43, "test", 11, "A", "ヒューマン", "茅原実里");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103801, "読書が趣味の病弱少女", 153, 11, "シオリ", 11, 0, "牧場（エリザベスパーク）", 14, "読書、お散歩", 40, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 3, "A", "獣人族", "小清水亜美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104001, "「友達」に憧れる、エルフの森の女の子", 158, 6, "アオイ", 6, 0, "フォレスティエ", 13, "友達作りのイメトレ", 44, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, "AB", "エルフ", "花澤香菜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104201, "人々を守るために歌う、唱喚士の少女", 163, 6, "チカ", 4, 0, "カルミナ", 17, "各種楽器", 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "O", "ヒューマン", "福原綾香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104301, "男勝りで情に厚いワイルド娘", 168, 8, "マコト", 10, 0, "自警団（カォン）", 17, "お菓子作り", 54, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 9, "O", "獣人族", "小松未可子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104401, "かつては夜を支配した最強の吸血鬼", 172, 5, "イリヤ", 7, 0, "悪魔偽王国軍（ディアボロス）", "??", "世界征服", 50, "test", 5, "A", "魔族", "丹下桜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104501, "妄想大好き！　ほんとは照れ屋な女の子", 157, 11, "クウカ", 15, 0, "ヴァイスフリューゲル　ランドソル支部", 18, "小説を読むこと", 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, "AB", "ヒューマン", "長妻樹里");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104601, "弱きを助け強きをくじく猫娘", 158, 3, "タマキ", 12, 0, "メルクリウス財団", 18, "猫とたわむれること", 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, "AB", "獣人族", "沼倉愛美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104701, "素顔を見せない冷静沈着な女性騎士", 171, 10, "ジュン", 8, 0, "王宮騎士団（NIGHTMARE）", 25, "格闘技、湯浴み", 50, "？？？", 25, "A", "ヒューマン", "川澄綾子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104801, "仕事も私事も効率優先な傭兵少女", 163, 11, "ミフユ", 12, 0, "メルクリウス財団", 20, "傭兵などのアルバイト", 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "O", "ヒューマン", "田所あずさ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104901, "お姉ちゃんがお世話してあげるからねっ！", 168, 10, "シズル", 3, 0, "ラビリンス", 18, "家事全般", 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, "O", "ヒューマン", "生天目仁美");
