INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105101, "実験が趣味の危険な科学者", 166, 3, "ミツキ", 13, 0, "トワイライトキャラバン", 27, "研究、実験", 53, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 7, "A", "ヒューマン", "三石琴乃");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105201, "乙女チックなもふもふアニマル", 150, 3, "リマ", 11, 0, "牧場（エリザベスパーク）", 18, "毛繕い、お喋り", 100, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 14, "A", "獣人族", "徳井青空");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105301, "見た目も中身もお子ちゃまな異国の軍人", 140, 7, "モニカ", 15, 0, "ヴァイスフリューゲル　ランドソル支部", 18, "お菓子屋通い", 33, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 28, "A", "ヒューマン", "辻あゆみ");
