INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105701, "空への冒険を夢見る騎空士の少女", 156, 3, "ジータ", "", 0, "？？？", 17, "冒険、おしゃべり", 45, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 10, "O", "ヒューマン", "金元寿子");
