INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108101, "占いが得意な霊能少女", 157, 12, "シノブ（ハロウィン）", 7, 0, "悪魔偽王国軍（ディアボロス）", 18, "占い", 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "AB", "魔族", "大坪由佳");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108201, "プリン大好きゴースト娘", 130, 1, "ミヤコ（ハロウィン）", 7, 0, "悪魔偽王国軍（ディアボロス）", 14, "プリンを食べること", 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, "B", "魔族", "雨宮天");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108301, "ちょっとおませな恋に恋する女の子", 120, 1, "ミサキ（ハロウィン）", 14, 0, "ルーセント学院", 11, "ファッション誌鑑賞、コスメ集め", 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, "A", "魔族", "久野美咲");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108401, "人々を守るために歌う、唱喚士の少女", 163, 6, "チカ（クリスマス）", 4, 0, "カルミナ", 17, "各種楽器", 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "O", "ヒューマン", "福原綾香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108501, "泣き虫で臆病な守ってあげたい女の子", 150, 6, "クルミ（クリスマス）", 9, 0, "サレンディア救護院", 12, "観劇、おままごと", 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "B", "ヒューマン", "植田佳奈");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108601, "ぷうきちといつも一緒！", 148, 5, "アヤネ（クリスマス）", 9, 0, "サレンディア救護院", 14, "屋内でできる遊び", 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "B", "ヒューマン", "芹澤優");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108701, "人助けが大好き！　前向き格闘娘", 155, 8, "ヒヨリ（ニューイヤー）", 2, 0, "トゥインクルウィッシュ", 16, "人助け、応援", 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "A", "獣人族", "東山奈央");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108801, "戦闘のサポートが得意な、心優しい少女", 158, 4, "ユイ（ニューイヤー）", 2, 0, "トゥインクルウィッシュ", 17, "料理、人間観察", 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "O", "ヒューマン", "種田梨沙");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108901, "クールで何事にも真っ直ぐな剣士", 163, 1, "レイ（ニューイヤー）", 2, 0, "トゥインクルウィッシュ", 18, "読書、乗馬、お茶", 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "B", "魔族", "早見沙織");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (109001, "運命の相手に一途すぎる乙女", 154, 7, "エリコ（バレンタイン）", 13, 0, "トワイライトキャラバン", 16, "実験、裁縫、料理", 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, "B", "魔族", "橋本ちなみ");
