INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (109201, "英霊と契約を結んだマナリアの天才王女", 156, 12, "アン", "", 0, "？？？", 17, "読書", 55, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 1, "AB", "ヒューマン", "日笠陽子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (109301, "マナリア魔法学院の新入生", 144, 2, "ルゥ", "", 0, "？？？", 15, "食べること、眠ること", 45, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 4, "O", "ヒューマン", "こやまきみこ");
